import BannerHomeComponent from "../../Component/Banner/Banner";

const Home = () => {
  return (
    <>
      <div className="home-wrapper">
        {/* banner */}
        <div className="banner-wrapper">
          <BannerHomeComponent />
        </div>
      </div>
    </>
  );
};

export default Home;
